import { Modal } from "@mui/material";
import React from "react";

const EditModal = ({ open, handelModalClose }) => {
  return (
    <Modal open={open}>
      <div style={{ height: "20%", width: "25%", background: "white" }}>
        <p
          style={{
            height: 30,
            width: 30,
            color: "red",
            cursor: "pointer",
            borderRadius: 15,
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            border: "1px solid red",
          }}
          onClick={handelModalClose}
        >
          X
        </p>
      </div>
    </Modal>
  );
};

export default EditModal;
